function countSubMultisets(nums: number[], l: number, r: number): number {
    const mod = 1e9 + 7;
    const sum = nums.reduce((a, b) => a + b, 0);
    const dp: number[][] = Array.from({ length: nums.length + 1 }, () => Array(sum + 1).fill(0));
    dp[0][0] = 1;
    for (let i = 1; i <= nums.length; i++) {
        for (let j = 0; j <= sum; j++) {
            dp[i][j] = dp[i - 1][j];
            if (j >= nums[i - 1]) {
                dp[i][j] += dp[i - 1][j - nums[i - 1]];
                dp[i][j] %= mod;
            }
        }
    }
    let ans = 0;
    for (let s = l; s <= r; s++) {
        for (let i = 1; i <= nums.length; i++) {
            ans += dp[i][s];
            ans %= mod;
        }
    }
    return ans;
}
